import React from 'react'

export default function Body() {
  return (
    <div><h1>Information sur React</h1>
    <ul>
      <li>Première sortie en 2013</li>
      <li>Créer par Jordan Walke</li>
      <li>Plus de 100K stars sur Github</li>
      <li>Maintenue par Facebook</li>
      <li>Utilisée en entreprise pour créer des applications incluant les applications mobile</li>
    </ul></div>
  )
}
